// @description  打开青年大学习的网页，自动生成手机观看完成状态下的（实时）截图，点击下载保存，也可以自定义时间和自定义选择手机背景图片，适用于主流浏览器，移动&桌面端通用。重要提醒，本脚本只提供学习交流的机会，只能生成截图，不会被后台统计，使用者需要自行去公众号签到。
// @author       Ayouth
// @supportURL   https://dev.ayouth.xyz/ayouth/msgboard/
// @match        *://h5.cyol.com/special/daxuexi/*
// @require      https://cdn.staticfile.org/FileSaver.js/2.0.5/FileSaver.min.js
